window.bookSummaryJSON = "<p>Could you be getting in your way of producing great work? Have you started a project but never finished? Would you like to do work that matters, but don't know where to start? The answer is <i>Do the Work</i>, a manifesto by best-selling author Steven Pressfield, that will show you that it’s not about better ideas, it’s about actually doing the work. <i>Do the Work</i> is a weapon against Resistance - a tool that will help you take action and successfully ship projects out the door. </p> <p>“There is an enemy. There is an intelligent, active, malign force working against us. Step one is to recognize this. This recognition alone is enormously powerful. It saved my life, and it will save yours.” For other titles like <i>Do the Work</i>, visit thedominoproject.com for more information.</p>"; 
